An individual with a disability is a person who: (1) has a physical or
                mental impairment that substantially limits one or more major life activities;
                OR (2) has a record of such impairment; OR (3) is regarded as having such impairment.

Um indivíduo com deficiência é uma pessoa que: (1) tem uma condição física ou
                comprometimento mental que limita substancialmente uma ou mais atividades importantes da vida;
                OU (2) tem um registro dessa deterioração; OU (3) é considerado como tendo tal comprometimento.
